Create a java class next to the BackendApplication, so in the backend/src/main/java/com/example/backend directory and name it TodoItem. Add the @Entity annotation to it to tell Spring and FeGen that instances of this class can be saved to the database. Create a public field named id of type long within the class and annotate it with @Id and @GeneratedValue. This ID will be used by FeGen to refer to specific instances of the TodoItem when changing or deleting them and it will be automatically assigned to an entity when it is created. Also add a String field named text to the class that will contain the description of the todo item and a boolean field done. Your class should now look like this: package com.example.backend; import javax.persistence.Entity;
import javax.persistence.GeneratedValue;
import javax.persistence.Id; @Entity
public class TodoItem { @Id @GeneratedValue public long id; public String text; public boolean done;
}

