If you execute ./gradlew fegenWeb now, you will still see a warning by FeGen: [FeGen ProjectionMgr] The following entities do not have a base projection:
[FeGen ProjectionMgr] TodoItem Base projections are needed for technical reasons. They are interfaces that should be nested into the entity class that they belong to. In our case, it would look like this: @Entity
public class TodoItem { // ... @Projection(name = "baseProjection", types = {TodoItem.class}) interface BaseProjection { long getId(); String getText(); boolean isDone(); }
} They need to meet the following criteria to be accepted by FeGen: Have a @Projection annotation with "baseProjection" as name and the corresponding entity class as only item in types Have a method defined for each property of the corresponding entity whose type is not an entity or projection The return type of the method must match the type of the corresponding property The name of the method must be the name of the getter of the property, even if no getter exists on the entity This guide does not handle using other entities or projections as entities' fields as mentioned in the second bullet point. To learn about it, go to the Relationships page of the reference documentation Your complete entity should look like this now and FeGen should not complain about it anymore: package com.example.backend; import org.springframework.data.rest.core.config.Projection; import javax.persistence.Column;
import javax.persistence.Entity;
import javax.persistence.GeneratedValue;
import javax.persistence.Id; @Entity
public class TodoItem { @Id @GeneratedValue public long id; @Column(nullable = false) public String text; public boolean done; @Projection(name = "baseProjection", types = {TodoItem.class}) interface BaseProjection { long getId(); String getText(); boolean isDone(); }
}

