To show the todo items when opening the web app, append the following code to your frontend/src/main.ts: /** * Create an HTML element representing the given todoItem */
const createTodoElement = (todoItem: TodoItem): HTMLElement => { const todoEl = document.createElement("div"); const doneEl = document.createElement("input"); doneEl.type = "checkbox"; doneEl.checked = todoItem.done; todoEl.appendChild(doneEl); const textEl = document.createElement("span"); textEl.textContent = todoItem.text; todoEl.appendChild(textEl); return todoEl;
} const loadTodoItems = () => { // Get the <div> element that will contain the items const listEl = document.querySelector("#todoItems")!; // Remove old items if there have been any listEl.innerHTML = ""; apiClient.todoItemClient.readAll().then(todoItems => { for (const todoItem of todoItems.items) { const itemEl = createTodoElement(todoItem); listEl.appendChild(itemEl); } }).catch(err => { console.error("Failed to fetch todo items", err); alert("Failed to fetch todo items") });
}; The line starting with apiClient refers to the variable you created in the previous step. It contains an instance of a class generated by FeGen. That class has a member called todoItemClient that contains method for basic CRUD functionality for the TodoItem entity like reading all instances of that entity. FeGen will create such a member for each Entity / Repository combination you define. The readAll method returns all todo item entity that currently exist in the backend. It does not return them as a plain array though, but as a Promise, so the execution of frontend code is not interrupted while the browser is waiting for the backend to respond. Using the then method of that Promise, we can specify what to do with the todo items once they are successfully retrieved from the backend. The todoItems parameter is correctly typed using a type generated by FeGen, so you can enjoy autocompletion while iterating through the contained items array and accessing the text property that you have defined for that entity in the backend. In case something goes wrong while retrieving the todo items (for example, if the backend server cannot be reached) the callback passed to the catch block is called, and you will see a dialog box. The method readAll actually does not return all elements by default, but only up to 20. To learn how to configure this behaviour, refer to the Paging and Sorting page of the reference documentation There are various ways besides a simple call to readAll to retrieve entities from the backend. For example, you can pass sorting and paging parameters to readAll to only retrieve a sublist of a certain length in a specific order. You can also create projections in the backend which specify a set of fields to return, which enables you to query related entities in one step. With repository and custom searches you are able to filter the entities that are returned by the backend. To learn how you can use these options with FeGen, refer to the Retrieving Data page of the reference documentation To actually run the code, you need to call the function that contains it, so append the following line at the bottom of main.ts: const onReady = () => { loadTodoItems();
}; if (document.readyState !== 'loading') { // HTML is already completely initialized onReady();
} else { // Wait until initialization has completed document.addEventListener('DOMContentLoaded', onReady);
} You can start the web app by running ./gradlew bootRun in the backend directory and at the same time running npm run dev in the frontend directory. However, if you open http://localhost:5000/ in your browser, you will only see the headline, because there aren't any todo items yet.

