</div> Now we still need to give that button some functionality. Add the following code between the loadTodoItems and the onReady function: const createTodo = async () => { const text = document.querySelector<HTMLInputElement>("#newTodoText").value; await apiClient.todoItemClient.create({ text, done: false }); // Use async function and await create result to avoid loading items before creation has finished loadTodoItems();
}; This will read the text out of the input element and use the code generated by FeGen to create a new instance of the todo item entity with that text in the backend. After it waits for that operation to complete, it loads the todo items from the server again and updates the list. If you are developing a real application, you should probably wrap the call to create together with the await in a try block and let the user know if an error occurred in the corresponding catch block. That is the async function equivalent to the error handling you did with catch when fetching all todo items. To run this code whenever the Create button is clicked, add the following line at the end of the onReady function body: document.querySelector<HTMLButtonElement>("#newTodoButton").onclick = createTodo; If you left ./gradlew bootRun and npm run dev running, you will now be able to add todo items by entering a text and pressing Create after reloading the page once. The todo items' texts should then appear below. Try to reload the page or close and open the browser, and you will see that the todo items appear again because they are persisted in the backend. If you stop and restart the backend, the todo items will be lost, since you are currently only using the h2 in-memory database. For applications used in a production environment, you should use a persistent database such as PostgreSQL.

