The first step to use FeGen is to include the FeGen plugins for either Typescript, Kotlin or both in your build file. If you are using gradle, you need to add a dependency in the buildscript within your build.gradle. Make sure you have mavenCentral() set as one of your buildscript repositories. You will need gradle version 6.0.1 or later for the plugin to work. buildscript { repositories { ... mavenCentral() } dependencies { ... classpath "com.github.materna-se.fegen:fegen-web-gradle-plugin:1.0-RC9" // For Typescript classpath "com.github.materna-se.fegen:fegen-kotlin-gradle-plugin:1.0-RC9" // For Kotlin }
