apply plugin: 'de.materna.fegen.kotlin' Applying the plugin enables you to configure the FeGen plugins using the fegenWeb and fegenKotlin sections. fegenWeb { scanPkg = "com.example.your.main.package" frontendPath = "../frontend/src/generated-client"
} fegenKotlin { scanPkg = "com.example.your.main.package" frontendPath = "../android-app/src/main/kotlin" frontendPkg = "com.example.your.main.package.api"
} You can find all configuration options on the Configuration Options page. If you want to use custom endpoints and are using a Spring version that ships with version 1.0.0 or later of spring-hateoas, you will need also need to add fegen-spring-util as a dependency. This ensures that links required by FeGen will be added to the return values of custom endpoints. dependencies { ... implementation "com.github.materna-se.fegen:fegen-spring-util:1.0-RC9"
} Once you are happy with your configuration, you can run the following command to have FeGen generate the client code in Typescript. ./gradlew fegenWeb To generate code in Kotlin, replace fegenWeb with fegenKotlin

