To access related entities in the generated code, you have two options. The first one is to use projections which enable you to fetch an entity and a whole set of (even transitively) related entities in one api call. To see how they work, refer to the page Projections . The other one is using the methods that are generated into the API clients of the entities that contain the relationships. For example, if you added the creator property to your TodoItem entity, you can now use the readCreator method to retrieve Users associated with a specific TodoItem. const todoItems: TodoItem[] = (await apiClient.todoItemClient.readAll()).items;
const todoItem = todoItems[27];
const user: User = await apiClient.todoItemClient.readCreator(todoItem); Such a read method is generated for all relationships mentioned earlier, although @OneToMany and @ManytoMany relationships will of course return an array instead of a single value. The corresponding Kotlin code is analogous. You can use the following methods to add or remove relationships between entities. It is important that all the objects passed to such a set method have already been created in the backend. Conversely, the todosToDelete object will not be deleted from the database. apiClient.userClient.setTodos(user, todos);
apiClient.userClient.deleteFromTodos(user, todosToDelete); If your relationship is @OneToMany or @ManyToMany, you can use the following method to add a single object to the relationship without removing the others. apiClient.userClient.addToTodos(room, todoToAdd);

