In order to generate the client for your backend, you need to add the FeGen plugin to your backend project. Add the following lines at the top of your build.gradle file for gradle to be able to load the FeGen web plugin: buildscript { repositories { mavenCentral() } dependencies { classpath "com.github.materna-se.fegen:fegen-web-gradle-plugin:1.0-RC8" }
} To actually apply FeGen to the project, add the following line below (not within) the plugins { ... } section: apply plugin: 'de.materna.fegen.web' To use custom endpoints with recent Spring versions, add fegen-spring-util as a dependency. This is also a prerequisite for FeGen Security to work, as it provides a Spring controller with meta information about security. dependencies { // ... implementation "com.github.materna-se.fegen:fegen-spring-util:1.0-RC8"
} FeGen Security lets you query your current permissions as a client. To learn more, refer to the FeGen Security page of the reference documentation The last change to the build.gradle file is adding the configuration for FeGen web. Place this below the dependencies { ... } section: fegenWeb { scanPkg = "com.example.backend" frontendPath = "../frontend/src/api-client"
} The first option tells FeGen where to look for your entities, repositories and controllers. The second one tells FeGen where to put the generated typescript files that contain the client code. We will create the referenced directory later. You can specify additional configuration options e.g. to control handling of dates or nullable values. To learn what configuration options exist, refer to the Plugin Configuration page of the reference documentation. After those steps, your build.gradle should look as follows: buildscript { repositories { mavenCentral() } dependencies { classpath "com.github.materna-se.fegen:fegen-web-gradle-plugin:1.0-RC8" }
} plugins { id 'org.springframework.boot' version '2.4.4' id 'io.spring.dependency-management' version '1.0.11.RELEASE' id 'java'
} apply plugin: 'de.materna.fegen.web' group = 'com.example'
version = '0.0.1-SNAPSHOT'
sourceCompatibility = '11' repositories { mavenCentral()
} dependencies { implementation 'org.springframework.boot:spring-boot-starter-data-jpa' implementation 'org.springframework.boot:spring-boot-starter-data-rest' implementation 'org.springframework.boot:spring-boot-starter-web' runtimeOnly 'com.h2database:h2' testImplementation 'org.springframework.boot:spring-boot-starter-test'
} fegenWeb { scanPkg = "com.example.backend" frontendPath = "../frontend/src/api-client"
} test { useJUnitPlatform()
} To finish setting up the backend, add the @Fegen annotation from the FeGen runtime to your BackendApplication, so it looks like this: @Fegen
@SpringBootApplication
public class BackendApplication { public static void main(String[] args) { SpringApplication.run(BackendApplication.class, args); } }

